// Footer.js
import React from 'react';

const Footer = () => {
    return (
        <footer>
            <div className="social-links">
                <a href="https://github.com/m75-ali" target="_blank" rel="noopener noreferrer">GitHub</a>
                <a href="https://www.linkedin.com/in/alimohamed5981/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
                <a href="mailto:ali.mohamed5981@gmail.com" target="_blank" rel="noopener noreferrer">Email</a>
            </div>
            <p>&copy; 2024 Mohamed Ali. All rights reserved.</p>
        </footer>
    );
};

export default Footer;
